var a=setTimeout(function(){
	$('.GridTableContent tr').each(
		function(){
			var line=$(this);
			var s=line.children('.tdrigtxt').text();
			if(s.search(/期刊/)>-1){
				var word=line.children('td')[3];
				if(cnki_core.search('/|'+$(word).children('a').text()+'|/')>-1){
					//console.log(cnki_core.match('|'+$(word).children('a').text()+'|'));
					$(word).children('a').css('background','#ff0');
				}else{
					var word1=$(word).children('a').text().replace(/[(].*$/g,'');
					word1=word1.replace(/[\. a-zA-Z0-9]/g,'');
					if(cnki_core.search('/|'+word1+'|/')>-1){
						$(word).children('a').css('background','#ff0');
					}
				}
			}
		}
	);
},100);